import logo from './logo.svg';
import './App.css';

function App() {
  const firstName = 'Sairam'
  const lastName = 'Nomula'
  const age = 19;
  return (
    <div className="App">
      <h3>Name: {firstName} {lastName}</h3>
      <p>age: {age}</p>
    </div>
  );
}

export default App;
